import Item from "./Item";
import React from "react";
import { Col, Row } from "react-bootstrap";
import { Link } from "react-router-dom";

const ItemList = (data) => {
    console.log("Estos son los productos", data.elements)

    /* const laRopa = data.elements */

    const getRopa = () => {
        const task = new Promise((res, rej) => {
            setTimeout(() => {
                res(data.elements)
            }, 2000)
        })
        task.then(result => {
            const laRopa = result
            return (
                <Row className="justify-content-md-center">
                    {laRopa.map((data) => (
                        <Col md="4" mb="2">
                            <Item prenda={data} />
                        </Col>
                    ))}
                </Row>
            )
        })
        task.catch(err => {
            console.log("esto es el error", err)
        })
    }

    async function informacion () {
        const ropa = await getRopa()
    }

    informacion()

}
